import React, { FC } from 'react';
import { Result, Button } from 'antd';
// import { ImageNotFound } from './image-not-found';
import './style.less';
import { HOME_URL } from '../../configs/vars';
import HeaderPage from "../../features/auth/pages/header-page";
import Image from '../../assets/icon/404.png';


interface Props {}

const NotFound: FC<Props> = () => {
    return (
        <div>
            <HeaderPage />
            {/* <img src={Image} /> */}
            <Result
                // icon={Image}
                icon={<img src={Image} />}
                extra={<Button type='primary' href={HOME_URL}>Trở về trang chủ</Button>}
            />

        </div>
    );
};

export { NotFound };
